import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    root: {
        display: 'grid',
        gridTemplateColumns: 'auto auto',
        gridTemplateRows: 'auto auto auto',
        listStyleType: 'none',
        columnGap: '20%',
        rowGap: '20%',
        marginTop: '5rem',
    }, 
    listeItem: {

        height: '5rem',
        borderRadius: '10px',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        fontSize: 'x-large',
        background: 'rgba(192,192,192,0.75)',
        boxShadow: '10px 5px 5px grey',
    }
}))

const ActionLayout = () => {
    const classes = useStyles();

    const handleClick = (e) => {
        e.preventDefault();
        console.log(e.target)
    }
    return (
        <div>
            <ul className={classes.root}>
                <li id="addUser" className={classes.listeItem} onClick={handleClick}>Add Users</li>
                <li id="deleteUser" className={classes.listeItem}>Delete Users</li>
                <li id="modifyUser" className={classes.listeItem}>Modify Users</li>
                <li id="getUser" className={classes.listeItem}>Get Users</li>
                <li id="assignGroup" className={classes.listeItem}>Assign Groups</li>
                <li id="addCourses" className={classes.listeItem}>Add Courses</li>
            </ul>
        </div>
    )
}

export default ActionLayout;
